




lines = ''
lenOfCheck = 14


for x in range(len(lines) - lenOfCheck + 1):

    #Build Header
    PacketCheck = ''
    for y in range(lenOfCheck):
        PacketCheck += lines[x+y]

    #Check for Unique Chars
    d = []
    for c in PacketCheck:
        if c not in d:
            d.append(c)

    #Check # of Unique Chars
    if len(d) == lenOfCheck:
        print(PacketCheck)
        print(x+lenOfCheck)
        break



